    <script>// Pandoc 2.9 adds attributes on both header and div. We remove the former (to

document.addEventListener('DOMContentLoaded', function(e) {
  var hs = document.querySelectorAll("div.section[class*='level'] > :first-child");
  var i, h, a;
  for (i = 0; i < hs.length; i++) {
    h = hs[i];
    if (!/^h[1-6]$/i.test(h.tagName)) continue;  // it should be a header h1-h6
    a = h.attributes;
    while (a.length > 0) h.removeAttribute(a[0].name);
  }
});
</script>

    <script>/* global slideshow,window,document */
window.xaringanExtraClipboard = function (selector, text) {
  if (!window.ClipboardJS.isSupported()) return
  if (!window.xaringanExtraClipboards) window.xaringanExtraClipboards = {}

  const ready = function (fn) {
    /* MIT License Copyright (c) 2016 Nuclei */
    /* https://github.com/nuclei/readyjs */
    const completed = () => {
      document.removeEventListener('DOMContentLoaded', completed)
      window.removeEventListener('load', completed)
      fn()
    }
    if (document.readyState !== 'loading') {
      setTimeout(fn)
    } else {
      document.addEventListener('DOMContentLoaded', completed)
      window.addEventListener('load', completed)
    }
  }

  ready(function () {
    const {
      button: buttonText = 'Copy Code',
      success: successText = 'Copied!',
      error: errorText = 'Press Ctrl+C to Copy'
    } = text

    const template = '<button class="xaringanextra-clipboard-button" ' +
       `type="button" aria-label="Copy code to clipboard">${buttonText}</button>`

    const isRemarkSlideshow = typeof slideshow !== 'undefined' &&
      Object.prototype.hasOwnProperty.call(slideshow, 'getSlides')

    let siblingSelector = selector || 'pre'
    if (!selector && isRemarkSlideshow) {
      siblingSelector = '.remark-slides-area ' + siblingSelector
    }

    // insert <button>s
    document.querySelectorAll(siblingSelector).forEach(el => {
      if ([/^$/, 'inherit', 'unset', 'revert', 'static'].some(p => el.style.position.match(p))) {
        el.style.position = 'relative'
      }
      el.insertAdjacentHTML('beforeend', template)

      // match button text color to code color
      const currentColor = window.getComputedStyle(el.children[0]).getPropertyValue('color')
      el.querySelector('button.xaringanextra-clipboard-button').style.color = currentColor
    })

    // initialize cliboardjs
    const clipboard = new window.ClipboardJS(siblingSelector + ' .xaringanextra-clipboard-button', {
      text: function (trigger) {
        // temporarily remove the button text
        // so that it isn't included in the text that's copied
        const btnLabel = trigger.innerHTML
        trigger.innerHTML = ''
        // snapshot text of copy button's parent element
        const text = trigger.parentElement.innerText
        // restore the button's inner HTML
        trigger.innerHTML = btnLabel
        return text
      }
    })

    // show success text for 2.5 seconds on success
    clipboard.on('success', function (ev) {
      ev.trigger.innerHTML = successText
      ev.trigger.style.display = 'block'
      setTimeout(function () {
        ev.trigger.innerHTML = buttonText
        ev.trigger.style.display = ''
      }, 2500)
      ev.clearSelection()
    })

    // show error text for 2.5 seconds on error
    clipboard.on('error', function (ev) {
      ev.trigger.innerHTML = errorText
      setTimeout(function () { ev.trigger.innerHTML = buttonText }, 2500)
    })

    // block remark click/touch slide change event listeners
    if (isRemarkSlideshow) {
      ['touchstart', 'touchend', 'touchmove'].forEach(function (evType) {
        document.querySelector('.remark-slides-area').addEventListener(evType, function (ev) {
          if (!ev.target.closest('pre')) return
          if (ev.target.closest('pre').querySelector('.xaringanextra-clipboard-button')) {
            ev.stopPropagation()
          }
        })
      })
    }

    window.xaringanExtraClipboards[siblingSelector] = clipboard
  })
}
</script>

    <script>/*
 *  Tile View for remark.js Slides
 *
 *  Garrick Aden-Buie
 *
 *  Inspired and converted to Vanilla JS from
 *  https://github.com/StephenHesperus/remark-hook/
 *
 *  Include after remarkjs slides are initialized.
 *
 */

/* global slideshow */
(function () {
  const ready = function (fn) {
    /* MIT License Copyright (c) 2016 Nuclei */
    /* https://github.com/nuclei/readyjs */
    const completed = () => {
      document.removeEventListener('DOMContentLoaded', completed)
      window.removeEventListener('load', completed)
      fn()
    }
    if (document.readyState !== 'loading') {
      setTimeout(fn)
    } else {
      document.addEventListener('DOMContentLoaded', completed)
      window.addEventListener('load', completed)
    }
  }

  ready(function () {
    const launchKey = 79 // keycode for O, used to enable tile view

    // Slides container
    const remarkSlideShow = document.querySelector('div.remark-slides-area')

    let tileView = document.querySelector('div.remark__tile-view')
    if (!tileView) {
      tileView = document.createElement('div')
      tileView.className = 'remark__tile-view'
    }

    const toggleElement = el => {
      el.style.display = el.style.display === 'none' ? '' : 'none'
    }

    function slideshowResize () {
      window.dispatchEvent(new Event('resize'))
    }

    const toggleTileView = function () {
      toggleElement(tileView)
      toggleElement(remarkSlideShow)

      if (tileView.style.display === 'none') {
        // tileView is now hidden, go to current slide
        slideshow.gotoSlide(tileVars.currentSlideIdx + 1)

        slideshow.resume()
        slideshowResize()
      } else {
        // store current slide index prior to launching tile-view
        tileVars.currentSlideIdx = slideshow.getCurrentSlideIndex()

        // set class on seen and current slide and scroll into view
        const tiles = tileView.querySelectorAll('.remark__tile-view__tile');
        [...tiles].forEach((tile, idx) => {
          tile.classList.toggle(
            'remark__tile-view__tile--seen',
            idx < tileVars.currentSlideIdx
          )
          tile.classList.toggle(
            'remark__tile-view__tile--current',
            idx === tileVars.currentSlideIdx
          )
        })
        tiles[tileVars.currentSlideIdx].scrollIntoView({
          behavior: 'smooth',
          block: 'center'
        })

        slideshow.pause()
      }
    }

    const createTileView = ({ minSize = 250, title = document.title } = {}) => {
      // Tile view header
      const h1 = document.createElement('h1')
      h1.className = 'remark__tile-view__header'
      h1.innerHTML = title

      tileView.appendChild(h1)
      const tiles = document.createElement('div')
      tiles.className = 'remark__tile-view__tiles'
      tileView.appendChild(tiles)

      // Clone slideshow
      const slidesArea = remarkSlideShow.cloneNode(true)

      // Calculate slide scale and tile container size
      const slideScaler = slidesArea.querySelector('.remark-slide-scaler')
      const slideWidth = parseFloat(slideScaler.style.width.replace('px', ''))
      const slideHeight = parseFloat(
        slideScaler.style.height.replace('px', '')
      )
      const scale = minSize / Math.min(slideWidth, slideHeight)
      let tileWidth = Math.round(slideWidth * scale)
      let tileHeight = Math.round(slideHeight * scale)

      // convert tileWidth/Height to em relative to base 18px (set in CSS)
      tileWidth = tileWidth / 18
      tileHeight = tileHeight / 18

      tiles.style.gridTemplateColumns = `repeat(auto-fill, minmax(${tileWidth}em, 1fr))`

      const slides = slidesArea.querySelectorAll('.remark-slide-container')

      slides.forEach((slide, slideIndex) => {
        let tile = document.createElement('template')
        tile.innerHTML = `<div class="remark__tile-view__tile">
            <div class="remark__tile-view__slide-container">
            </div></div>`
        tile = tile.content.firstChild

        const tileContainer = tile.querySelector(
          '.remark__tile-view__slide-container'
        )
        tileContainer.style.width = `${tileWidth}em`
        tileContainer.style.height = `${tileHeight}em`

        const thisSlideScaler = slide.querySelector('.remark-slide-scaler')
        thisSlideScaler.style.top = '0px'
        thisSlideScaler.style.left = '0px'
        thisSlideScaler.style.transform = `scale(${scale})`
        thisSlideScaler.parentElement.classList.add('remark-visible')

        slide.addEventListener('click', () => {
          tileVars.currentSlideIdx = slideIndex
          toggleTileView()
        })

        tileContainer.appendChild(slide)
        tiles.appendChild(tile)
      })

      document.body.appendChild(tileView)
    }

    const tileVars = {}

    document.addEventListener('keydown', ev => {
      if (ev.keyCode === launchKey) {
        toggleTileView()
      }
    })

    const addTileViewHelpText = () => {
      const helpTable = document.querySelector(
        '.remark-help-content table.light-keys'
      )
      if (!helpTable) {
        console.error(
          'Could not find remark help table, has remark been initialized?'
        )
        return
      }
      const newRow = document.createElement('tr')
      newRow.innerHTML += '<td><span class="key">o</span></td>'
      newRow.innerHTML += '<td>Tile View: Overview of Slides</td>'
      helpTable.append(newRow)
    }

    createTileView({ minSize: 200 })
    toggleElement(tileView)
    addTileViewHelpText()
  })
})()
</script>

:root {

--text-font-family: 'Noto Sans';
--text-font-is-google: 1;
--text-font-family-fallback: -apple-system, BlinkMacSystemFont, avenir next, avenir, helvetica neue, helvetica, Ubuntu, roboto, noto, segoe ui, arial;
--text-font-base: sans-serif;
--header-font-family: Cabin;
--header-font-is-google: 1;
--header-font-family-fallback: Georgia, serif;
--code-font-family: 'Source Code Pro';
--code-font-is-google: 1;
--base-font-size: 20px;
--text-font-size: 1rem;
--code-font-size: 0.9rem;
--code-inline-font-size: 1em;
--header-h1-font-size: 2.75rem;
--header-h2-font-size: 2.25rem;
--header-h3-font-size: 1.75rem;

--text-color: #18273F;
--header-color: #23395b;
--background-color: #E9EBEE;
--link-color: #23395b;
--text-bold-color: #23395b;
--code-highlight-color: rgba(255,255,0,0.5);
--inverse-text-color: #E9EBEE;
--inverse-background-color: #23395b;
--inverse-header-color: #E9EBEE;
--inverse-link-color: #23395b;
--title-slide-background-color: #23395b;
--title-slide-text-color: #E9EBEE;
--header-background-color: #23395b;
--header-background-text-color: #E9EBEE;
--base: #23395b;
--white: #E9EBEE;
--black: #18273F;
}
html {
font-size: var(--base-font-size);
}
body {
font-family: var(--text-font-family), var(--text-font-family-fallback), var(--text-font-base);
font-weight: normal;
color: var(--text-color);
}
h1, h2, h3 {
font-family: var(--header-font-family), var(--header-font-family-fallback);
font-weight: 600;
color: var(--header-color);
}
.remark-slide-content {
background-color: var(--background-color);
font-size: 1rem;
padding: 16px 64px 16px 64px;
width: 100%;
height: 100%;
}
.remark-slide-content h1 {
font-size: var(--header-h1-font-size);
}
.remark-slide-content h2 {
font-size: var(--header-h2-font-size);
}
.remark-slide-content h3 {
font-size: var(--header-h3-font-size);
}
.remark-code, .remark-inline-code {
font-family: var(--code-font-family), Menlo, Consolas, Monaco, Liberation Mono, Lucida Console, monospace;
}
.remark-code {
font-size: var(--code-font-size);
}
.remark-inline-code {
font-size: var(--code-inline-font-size);
color: #23395b;
}
.remark-slide-number {
color: #23395b;
opacity: 1;
font-size: 18px;
}
strong {
font-weight: bold;
color: var(--text-bold-color);
}
a, a > code {
color: var(--link-color);
text-decoration: none;
}
.footnote {
position: absolute;
color: gray;
bottom: 60px;
padding-right: 4em;
font-size: 20px;
}
.remark-code-line-highlighted {
background-color: var(--code-highlight-color);
}
.inverse {
background-color: var(--inverse-background-color);
color: var(--inverse-text-color);
}
.inverse h1, .inverse h2, .inverse h3 {
color: var(--inverse-header-color);
}
.inverse a, .inverse a > code {
color: var(--inverse-link-color);
}
.title-slide, .title-slide h1, .title-slide h2, .title-slide h3 {
color: var(--title-slide-text-color);
}
.title-slide {
background-color: var(--title-slide-background-color);
}
.title-slide .remark-slide-number {
display: none;
}

.left-column {
width: 20%;
height: 92%;
float: left;
}
.left-column h2, .left-column h3 {
color: #23395b99;
}
.left-column h2:last-of-type, .left-column h3:last-child {
color: #23395b;
}
.right-column {
width: 75%;
float: right;
padding-top: 1em;
}
.pull-left {
float: left;
width: 47%;
}
.pull-right {
float: right;
width: 47%;
}
.pull-right + * {
clear: both;
}
img, video, iframe {
max-width: 100%;
}
blockquote {
border-left: solid 5px #23395b80;
padding-left: 1em;
}
.remark-slide table {
margin: auto;
border-top: 1px solid #666;
border-bottom: 1px solid #666;
}
.remark-slide table thead th {
border-bottom: 1px solid #ddd;
}
th, td {
padding: 5px;
}
.remark-slide thead, .remark-slide tfoot, .remark-slide tr:nth-child(even) {
background: #D3D7DE;
}
table.dataTable tbody {
background-color: var(--background-color);
color: var(--text-color);
}
table.dataTable.display tbody tr.odd {
background-color: var(--background-color);
}
table.dataTable.display tbody tr.even {
background-color: #D3D7DE;
}
table.dataTable.hover tbody tr:hover, table.dataTable.display tbody tr:hover {
background-color: rgba(255, 255, 255, 0.5);
}
.dataTables_wrapper .dataTables_length, .dataTables_wrapper .dataTables_filter, .dataTables_wrapper .dataTables_info, .dataTables_wrapper .dataTables_processing, .dataTables_wrapper .dataTables_paginate {
color: var(--text-color);
}
.dataTables_wrapper .dataTables_paginate .paginate_button {
color: var(--text-color) !important;
}

.remark-slide-content.left pre,
.remark-slide-content.center pre,
.remark-slide-content.right pre {
text-align: start;
width: max-content;
max-width: 100%;
}
.remark-slide-content.left pre,
.remark-slide-content.right pre {
min-width: 50%;
min-width: min(40ch, 100%);
}
.remark-slide-content.center pre {
min-width: 66%;
min-width: min(50ch, 100%);
}
.remark-slide-content.left pre {
margin-left: unset;
margin-right: auto;
}
.remark-slide-content.center pre {
margin-left: auto;
margin-right: auto;
}
.remark-slide-content.right pre {
margin-left: auto;
margin-right: unset;
}

.remark-slide-content.header_background > h1 {
display: block;
position: absolute;
top: 0;
left: 0;
width: 100%;
background: var(--header-background-color);
color: var(--header-background-text-color);
padding: 2rem 64px 1.5rem 64px;
margin-top: 0;
box-sizing: border-box;
}
.remark-slide-content.header_background {
padding-top: 7rem;
}
@page { margin: 0; }
@media print {
.remark-slide-scaler {
width: 100% !important;
height: 100% !important;
transform: scale(1) !important;
top: 0 !important;
left: 0 !important;
}
}
.base {
color: var(--base);
}
.bg-base {
background-color: var(--base);
}
.white {
color: var(--white);
}
.bg-white {
background-color: var(--white);
}
.black {
color: var(--black);
}
.bg-black {
background-color: var(--black);
}

# Overview

---
class: onecol
## Plan for Today

Thus far, we have learned {rsample}, {workflows}, {recipes}, {yardstick}, and {parsnip}.

This lecture aims to tie it all together and .imp[build a model from start to finish].

--

&lt;p style=&quot;padding-top:30px;&quot;&gt;We will adapt **familiar classification algorithms** to a predictive modeling framework.

This will **ease the transition to ML** and highlight its similarities with classical statistics.

Finally, we have a **hands-on coding activity** to build your own predictive model.

---
class: onecol
## Applied Example

Let&#39;s put what we learned into practice in R! 

Let&#39;s train a classification model on the `titanic` data to predict survival.

--

&lt;p style=&quot;padding-top:30px;&quot;&gt;We will: 

- Load the data

- Create a recipe for feature engineering

- Train a classification model to predict if each passanger survived the titanic

- Evaluate the model using 10-fold cross-validation 

- Interpret the model 

---
class: onecol
## Load Data, Create Splits and Recipe


```r
library(tidymodels)
titanic &lt;- read.csv(&quot;https://tinyurl.com/titanic-pm&quot;)

surv_split &lt;- initial_split(titanic, prop = 0.8, strata = survived)
surv_train &lt;- training(surv_split)
surv_test &lt;- testing(surv_split)

surv_recipe &lt;- 
  recipe(titanic, formula = survived ~ .) %&gt;%
  step_naomit(survived) %&gt;% 
  step_mutate(
    survived = factor(survived),
    pclass = factor(pclass),
    sex = factor(sex)
  ) %&gt;% 
  step_dummy(all_nominal_predictors()) %&gt;%
  step_impute_linear(age, fare) %&gt;%
  step_nzv(all_predictors()) %&gt;%
  step_corr(all_predictors()) %&gt;%
  step_lincomb(all_predictors()) %&gt;% 
  step_normalize(all_numeric_predictors())
```

---
class: onecol
## Specify Model with {parsnip}


```r
# Specify Model
log_reg &lt;- logistic_reg() %&gt;% 
  set_engine(&quot;glm&quot;) %&gt;%
  set_mode(&quot;classification&quot;)

log_reg
#&gt; Logistic Regression Model Specification (classification)
#&gt; 
#&gt; Computational engine: glm
```

---
class: onecol
## Build Workflow with {workflows}

.scroll.h-0l[

```r
surv_wflow &lt;- 
  workflow() %&gt;%
  add_model(log_reg) %&gt;%
  add_recipe(surv_recipe)

surv_wflow
#&gt; ══ Workflow ════════════════════════════════════════════════════════════════════
#&gt; Preprocessor: Recipe
#&gt; Model: logistic_reg()
#&gt; 
#&gt; ── Preprocessor ────────────────────────────────────────────────────────────────
#&gt; 8 Recipe Steps
#&gt; 
#&gt; • step_naomit()
#&gt; • step_mutate()
#&gt; • step_dummy()
#&gt; • step_impute_linear()
#&gt; • step_nzv()
#&gt; • step_corr()
#&gt; • step_lincomb()
#&gt; • step_normalize()
#&gt; 
#&gt; ── Model ───────────────────────────────────────────────────────────────────────
#&gt; Logistic Regression Model Specification (classification)
#&gt; 
#&gt; Computational engine: glm
```
]

---
class: onecol
## Configure Resampling


```r
set.seed(2022)

# configure resampling
surv_folds &lt;- vfold_cv(
  data = surv_train,
  v = 10, 
  repeats = 3,
  strata = survived
)
```

--

The goal of `fit_resamples()` is to .imp[estimate model performance]. 

Therefore, by default, the models trained are not saved or used later.

---
class: onecol
## Configure Resampling

To save each predictions from each resampled model, we need to specify it in `control_resamples()`: 

--


```r
# save predictions from resampling
keep_pred &lt;- control_resamples(save_pred = TRUE)
```

---
class: onecol
## Fit Model with Resampling

Now that we&#39;ve set the workflow &amp; configured resampling, we&#39;re ready to fit the model! 

--

.scroll.h-1l[

```r
# train the model using the recipe, data, and method 
surv_fitr &lt;- 
  surv_wflow %&gt;%
  fit_resamples(
    resamples = surv_folds, 
    control = keep_pred
  )

surv_fitr

# Model Interpretation

---
class: onecol
## Model Interpretation 

Predictive **accuracy** is emphasized in ML over interpretability and inference

- The main goal of most applied ML studies is to **quantify performance**

--

But, we can get insight into an algorithm&#39;s decision-making via .imp[variable importance]. 

- Variable importance shows how much a model &quot;uses&quot; features to make  predictions.

- As a model usually used for inference, logistic regression has strong interpretability

- However, other models (e.g., random forests) are less directly interpretable.

- Variable importance is helpful for understanding what&#39;s going on in models.

--

The `vip()` function in the {vip} package illustrates variable importance for ML models.


.footnote[
See a full list of how {vip} creates variable importance scores [here](https://koalaverse.github.io/vip/reference/vi_model.html): 
]

---
class: onecol
## Variable Importance

{vip} requires a **final model**, so we can re-fit a logistic regression on the full dataset.

--


```r
library(vip)

# fit final model using the workflow specified previously
surv_final &lt;- 
  surv_wflow %&gt;% 
  last_fit(surv_split)
```

---
class: onecol
## Variable Importance

From this final model, we can **extract the fit** and visualize the most important features. 

--


```r
surv_final %&gt;% extract_fit_parsnip() %&gt;% vip()
```
